import { Link } from 'react-router-dom'

class Heading extends React.Component {
    constructor() {
        super()
        this.state = {}
    }

    render(){
        return (
            <div>
                <Link to = "/" className = "recipes">Recipes</Link>
                <Link to = "/add" className = "addrecipe">Add a Custom Recipe!</Link>
            </div>
        )
    }


}

export default Heading
